const Video = ({ video }) =>{
    console.log(video);
    return (
        <div className="video">
            <img src={`${video.snippet.thumbnails.default.url}`} alt=""/>
            <p className="title">{`${video.snippet.thumbnails.default.url}`}</p>
            <div className="date-set">
                <img />
                <p className="date"></p>
            </div>
        </div>
    )
}
export default Video;
